import React from 'react';
import Logo from './components/logo/logo';
import Searchbar from './components/searchbar/searchbar';
import './App.css';
import Particles from 'react-particles-js';
const setpart={
  particles:{
    number:{
      value:800,
      density:{
        enable:true,
        value_area:800
      }
    }
  }
}

function App() {
  return (
    <div>
      <Particles className='particles'
               prams={{setpart}}/>
      <Logo/>
      <div style={{display:'flex',justifyContent:'center',marginTop:'10%'}}>
    <div>
    <h1 color="white"><i color="white">FACE DETECTION SYSTEM</i></h1>
    <div className='pa5 dib shadow-4 br3 custom'>
      <Searchbar />
      </div>
    </div>
    </div>
    </div>
  );
}

export default App;
